import React from 'react';
import { Provider } from "react-redux";
import store from "./store";
import BaseComponent from "./compenents"

function App() {
  return (
    <Provider store={store}>
    <div className="App">
      <BaseComponent/>
    </div>
  </Provider>
  );
}

export default App;
